description:
Luna Park Ride is the third live album released by the Finnish soprano Tarja Turunen as a solo artist. 
The concert was filmed at Stadium Luna Park in Buenos Aires, Argentina by the fans and mixed by Tim Palmer. 
Apart from this show the release also contains 70 minutes of bonus material during 2010-2014.

